import React from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/swiper-bundle.min.css';
import 'swiper/components/navigation/navigation.min.css';
import 'swiper/components/pagination/pagination.min.css';
import 'swiper/components/effect-fade/effect-fade.min.css';
import 'swiper/components/autoplay/autoplay.min.css';

// Import Swiper core and required modules
import { Navigation, Pagination, Autoplay, EffectFade } from 'swiper/modules';

// Install Swiper modules
Swiper.use([Navigation, Pagination, Autoplay, EffectFade]);

const Home = () => {
  return (
    <section id="home">
      <h2>Welcome to the Travel Guide</h2>
      <Swiper
        spaceBetween={30}
        effect="fade"
        navigation
        pagination={{ clickable: true }}
        autoplay={{ delay: 5000 }}
        loop
      >
        <SwiperSlide style={{ backgroundImage: "url('/images/new-york.jpg')" }}>
          Discover New York
        </SwiperSlide>
        <SwiperSlide style={{ backgroundImage: "url('/images/paris.jpg')" }}>
          Explore Paris
        </SwiperSlide>
        <SwiperSlide style={{ backgroundImage: "url('/images/tokyo.jpg')" }}>
          Visit Tokyo
        </SwiperSlide>
      </Swiper>
    </section>
  );
};

export default Home;
